 @ajs1998  It's dishonest to say that mathematicians are "unimpressed" with GPT. As always with AI topics, we have the whole range of "believers" vs "unimpressed".

Math is literally the hardest topic there is, and I would assume it will be the very last cognitive task AI will be better than humans at. So, of course, at its current level, there's no real threat to mathematicians.


But give me a break, this technology is 5 years old... "it could maybe pass as an undergraduate" ? Yeah ? Doesn't that sound absolutely mindblowing ? 5 years ago we had absolutely nothing that could do general math in any meaningful way.
